import React, { Component } from "react";
import axios from "axios";
import Expanded from "../Assets/ExpandedInsurence.jpg";
class MostFQBenefits extends Component {
  constructor(props) {
    super(props);
    this.state = {
      facilities: [],
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData = async () => {
    try {
      const response = await axios.get(
        "http://195.210.47.82:8000/facility/main/"
      );
      this.setState({ facilities: response.data });
      console.log(response.data); // Вывод данных в консоль браузера (для отладки)
    } catch (error) {
      console.error("Ошибка при получении данных:", error);
    }
  };

  render() {
    const { facilities } = this.state;

    return (
      <section className="programs" id="programs">
        {facilities.length > 0 ? (
          <div className="programs__container">
            {facilities.map((facility) => (
              <div key={facility.id} className="programs__item">
                <h2 className="programs__title">{facility.name}</h2>
                <img
                  src={Expanded}
                  alt={program.title}
                  className="programs__item--img"
                />
                {facility.programs && facility.programs.length > 0 ? (
                  <div>
                    {facility.programs.map((program) => (
                      <div key={program.id}>
                        <strong>Title:</strong> {program.title}
                        <br />
                        <strong>Description:</strong> {program.description}
                        <br />
                        <strong>Expired Date:</strong> {program.expired_date}
                        <br />
                        <strong>Cost:</strong> {program.cost}
                        <br />
                        <img
                          src={Expanded}
                          alt={program.title}
                          className="programs__item--img"
                        />
                        {/* Дополнительные поля программы, если есть */}
                      </div>
                    ))}
                  </div>
                ) : (
                  <p>No programs found for this facility.</p>
                )}
              </div>
            ))}
          </div>
        ) : (
          <p>Loading...</p>
        )}
      </section>
    );
  }
}

export default MostFQBenefits;
